import React from 'react'
import styles from '../styles/Reviews.module.css'
import Slider from "react-slick";
const Reviews = () => {

    let settings = {
        infinite: false,
        speed: 1000,
        arrows: true,
        slidesToShow: 5,
        slidesToScroll: 4,
    
        responsive: [
          {
            breakpoint: 960,
            settings: {
              slidesToShow: 3,
              slidesToScroll: 2,
            },
          },
          {
            breakpoint: 480,
            settings: {
              slidesToShow: 1,
              slidesToScroll: 2,
            },
          },
        ],
      };
    return (
        <div>
            <Slider {...settings}>
            <div >
              <div className={styles.card}>
                
                <div className={styles.cardBody}>
                    <h1>jhsdbjhdbb</h1>
                </div>
              </div>
            </div>
                
            </Slider>
        </div>
    )
}

export default Reviews
